import React from 'react';
import Loadbar from './LoadingElem';
import '../../CSS/Main.css';

const navbar =props => {
    return(
       <main className="Navbar">
            <header className="NavbarBody">
                <nav>
                    <div className="Logo"><a href='/'><img src="../Assets/Navbar/Logo.png"></img></a></div>
                    <div className="">Soduko Online</div>
                    <div>
                        <ul>
                            <li><a href="/">LeaderBoards</a></li>
                            <li><a href="/">Login</a></li>
                        </ul>
                    </div>
                </nav>
            </header>
            <Loadbar/>
        </main> 
    )
};
export default navbar;
